import React from 'react'
import logo from '../images/res-logo.png'
import {NavLink, Link } from 'react-router-dom'

const Header = () => {
    const nav_links =[
        {
          display: 'Home',
          path: '/home'
        },
        {
          display: 'Foods',
          path: '/foods'
        },
        {
          display: 'Cart',
          path: '/cart'
        },
        {
          display: 'Contact',
          path: '/contact'
        }
    ]
    return (
        <div className='header  d-flex align-items-center justify-content-between'>
            <div className='logo_name'>
                <img src={logo} alt="logo" className='logo' />
                <h5 className='rest_name'>GRUBHUB</h5>
            </div>
            {/*
            <div className='search'>
                <span className='search_icon'><i class="ri-search-line"></i></span>

                <input type="search" 
                    id="fsearch" 
                    name="fsearch"
                    placeholder='Search for different types of food...'
                    className='search_text'
                />
            </div>
            */}
            <div >
            <div className=' d-flex align-items-center justify-content-between gap-5' >
                {
                nav_links.map((item, index)=>(
                    <NavLink 

                    to={item.path} 
                    key={index}
                    className={(navClass) => navClass.isActive ? "active_menu" : ""}
                    >
                        {item.display}
                    </NavLink>
                ))
                }
            </div>
            </div>
            <div className='nav_right d-flex align-items-center gap-4'>
                <span className='user'>
                    <i className="ri-user-3-line"></i>
                </span>
            </div>
        </div>
    )
    }


    export default Header
